ble land passage from the Kingdom of Stormwind to Khaz Modan and Lordaeron. The highway is thus well traveled, but still very dangerous. Now virtually abandoned by the Kingdom of Stormwind, the Burning Steppes is controlled by minions of the black dragonflight and agents of the firelord Ragnaros.\n\nThis rugged region is full of craggy foothills, scattered boulders and warring factions. Rivers of lava dot the landscape, as well as charred earth and burning ruins. The sky is a red hue here, due to sporadic eruptions from Blackrock Mountain. Blackrock Spire, an orc stronghold in the Second War, stands proud and defiant among the mountains. Dark Iron dwarves control the fortress's deeps, though rumor has it that Ragnaros the Fire Lord still broods in the shadows. Black dragons under Nefarion hold the spire's upper levels, and the two groups battle constantly for supremacy. The surrounding countryside is home to Blackrock orcs and Fire-Gut ogres, all brutal castoffs from the Second War. The Molten Span, a massive stone edifice in the north, bridges a river of fire and leads to Khaz Modan.",g={h(-12,{ach(775,{awp=30002,g={crit(1281,{achID=42,awp=30002,id=1})}})}),h(-30,{exp(255,{crit(1144,{achID=775,awp=30002,id=1})}),exp(254,{crit(1145,{achID=775,awp=30002,id=1})}),exp(2417,{crit(1139,{achID=775,awp=30002,id=1})}),exp(252,{crit(1142,{achID=775,awp=30002,id=1})}),exp(2421,{crit(1143,{achID=775,awp=30002,id=1})}),exp(249,{crit(1136,{achID=775,awp=30002,id=1})}),exp(2418,{crit(1137,{achID=775,awp=30002,id=1})}),exp(250,{crit(1140,{achID=775,awp=30002,id=1})}),exp(2420,{crit(1138,{achID=775,awp=30002,id=1})}),exp(253,{crit(1141,{achID=775,awp=30002,id=1})})}),h(-32,{fp(70,{coords={{65.6,24.2,1428}},crs={13177},r=1}),fp(71,{coords={{84.4,68.2,1428}},crs={2299},r=2})}),h(-45,{q(7630,{c={9},coords={{12.4,31.6,1428}},cost={{"i",12360,1}},lvl=60,qgs={14437},rwp=40003,sourceQuests={7626,7627,7628}}),q(7626,{c={9},coords={{12.6,31.6,1428}},cost={{"i",9264,2}},lvl=60,qgs={14436},rw