uldron fields, and Sorrow Hill. The Scarlet Crusade has a significant holding in and around Hearthglen to the north, and the Alliance has settled in the small Chillwind Camp to the south.\n\nLike their eastern counterparts, the Western Plaguelands were once fertile and beautiful but are now gray, blighted and noxious. Undead wander the land and haunt the abandoned towns and farmsteads. The largest Scourge city here is Andorhal, beneath which is an underground complex housing the undead's School of Necromancy. The Scarlet Crusade strikes against the Scourge from Hearthglen. The only place of any sanity in the Western Plaguelands is Uther's Tomb, a consecrated monument to the fallen hero Uther Lightbringer.",g={h(-12,{ach(770,{awp=30002,g={crit(1296,{achID=42,awp=30002,id=1})}})}),h(-30,{exp(2298,{collectible=false,g={crit(1069,{achID=770,awp=30002,id=1})}}),exp(200,{crit(1074,{achID=770,awp=30002,id=1})}),exp(2297,{crit(1068,{achID=770,awp=30002,id=1})}),exp(2625,{collectible=false}),exp(199,{crit(1073,{achID=770,awp=30002,id=1})}),exp(201,{crit(1078,{achID=770,awp=30002,id=1})}),exp(190,{crit(1077,{achID=770,awp=30002,id=1})}),exp(192,{crit(1076,{achID=770,awp=30002,id=1})}),exp(193,{crit(1071,{achID=770,awp=30002,id=1})}),exp(197,{crit(1070,{achID=770,awp=30002,id=1})}),exp(813,{crit(1072,{achID=770,awp=30002,id=1})}),exp(198,{crit(1079,{achID=770,awp=30002,id=1})}),exp(202,{crit(1075,{achID=770,awp=30002,id=1})}),exp(2620,{crit(1080,{achID=770,awp=30002,id=1})})}),h(-32,{fp(66,{coords={{42.8,85,1422}},crs={12596},r=2}),fp(383,{awp=30300,coords={{69.3,49.7,1422}},crs={37888}})}),h(-45,{q(5066,{coords={{54.8,62.6,1453}},isBreadcrumb=1,lvl=50,nextQuests={5092},qgs={2198},r=2,rwp=40003}),q(5090,{coords={{31.6,67,1455}},isBreadcrumb=1,lvl=50,nextQuests={5092},qgs={10877},r=2,rwp=40003}),q(5091,{coords={{36.4,39.8,1457}},isBreadcrumb=1,lvl=50,nextQuests={5092},qgs={10878},r=2,rwp=40003}),q(10373,{awp=20001,coords={{55.4,47.2,1947}},isBreadcrumb=1,lvl=50,nextQuests={5092